import React, { useState, useEffect } from "react";
import NavBar from "./Navbar";

function StudentHome() {
  const username = localStorage.getItem("username");
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:4002/studentview")
      .then((res) => res.json())
      .then((result) => setData(result));
  }, []);

  const filterdata = data.filter((value) => value.Teachername === username);

  return (
    <>
      <NavBar />
      <div className="container mt-4" style={{ backgroundImage: "url(public/imgschool.jpeg')", backgroundSize: "cover", backgroundPosition: "center" }}>
        <div className="row justify-content-center">
          <div className="col-md-6 alert alert-primary">
            <div className="bg-light rounded h-100 p-4 text-center">
              <h4 className="mb-4">Profile</h4>
              <img
                className="rounded-circle me-lg-2"
                src={
                  filterdata[0]?.Image
                    ? `http://localhost:4002/${filterdata[0].Image}`
                    : "img/user.jpeg"
                }
                alt=""
                style={{ width: "40px", height: "40px" }}
              />
              <br />
              <p className="text-center">Name: {username}</p>
              <p className="text-center">Subject: Maths</p>
              <a href="/teacherprofile" className="stretched-link"></a>
            </div>
          </div>
        </div>

        <div className="row justify-content-center mt-4">
          <div className="col-md-3 alert alert-secondary">
            <div className="bg-light rounded h-100 p-4 text-center">
              <h6 className="mb-4">
                <a href="/studentexam">Exam</a>
              </h6>
            </div>
          </div>
          <div className="col-md-3 alert alert-secondary">
            <div className="bg-light rounded h-100 p-4 text-center">
              <h6 className="mb-4">Performance</h6>
            </div>
          </div>
        </div>

        <div className="col-md-12 alert alert-success mt-4">
          <div className="bg-light rounded h-100 p-3">
            <h4 className="mb-4 text-center">My Classes</h4>
            <div className="d-flex flex-wrap justify-content-center">
              <div className="col-md-3 alert alert-danger m-3">
                <div className="bg-light rounded h-100 p-3">
                  <a href="/activeexam" className="stretched-link">
                    <p>ACTIVE EXAMS</p>
                  </a>
                </div>
              </div>
              <div className="col-md-3 alert alert-danger m-3">
                <div className="bg-light rounded h-100 p-3">
                  <a href="/completedexams" className="stretched-link">
                    <p>PREVIOUS EXAM</p>
                  </a>
                </div>
              </div>
              <div className="col-md-3 alert alert-danger m-3">
                <div className="bg-light rounded h-100 p-3">
                  <a href="/upcoming" className="stretched-link">
                    <p>UPCOMING EXAMS</p>
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default StudentHome;
// Replace `'your-background-image-url.jpg'` with the URL or path of your desired background image. The `backgroundSize: "cover"` and `backgroundPosition: "center"` styles ensure that the background image covers the entire container and is centered.
